import React, { useEffect, useState } from "react";
import './style.css'; // Import the CSS file for styling
import AreaChartComponent from './Components/AreaChart/AreaChart';
import BarChart from './Components/BarChart/BarChart';
import StackedBarChart from './Components/StackedBarChart/StackedBarChart';
import HorizontalBarChart from './Components/HorizontalBarChart/HorizontalBarChart';
import GroupedBarChart from './Components/GroupedBarChart/GroupedBarChart';
import BubbleChart from './Components/BubbleChart/BubbleChart';
import VolumeProfileChart from './Components/VolumeProfileChart/VolumeProfileChart';
import Kagi from './Components/Kagi/Kagi';
import HeikinAshi from './Components/HeikinAshi/HeikinAshi';

const App = () => {
  const [dataLoaded, setDataLoaded] = useState(false);

  useEffect(() => {
    // Simulate an API call or data loading process
    setTimeout(() => {
      setDataLoaded(true);
    }, 2000);
  }, []);

  return (
    <div className="container">
      <div className="column">
        {dataLoaded && <AreaChartComponent />}
        {dataLoaded && <BarChart />}
        {dataLoaded && <StackedBarChart />}
      </div>
      <div className="column">
        {dataLoaded && <HorizontalBarChart />}
        {dataLoaded && <GroupedBarChart />}
        {dataLoaded && <BubbleChart />}
      </div>
      <div className="column">
        {dataLoaded && <VolumeProfileChart />}
        {dataLoaded && <Kagi />}
        {dataLoaded && <HeikinAshi />}
      </div>
    </div>
  );
};

export default App;
